class Solution(object):
    def minSum(self, nums1, nums2):
        """
        :type nums1: List[int]
        :type nums2: List[int]
        :rtype: int
        """
        sum1, sum2 = sum(nums1), sum(nums2)
        zero_count1, zero_count2 = nums1.count(0), nums2.count(0)
        if sum1 > sum2:
            diff = sum1 - sum2
            if zero_count2 == 0 or (diff + zero_count2) % zero_count2 != 0:
                return -1
            return sum1 + zero_count1
        elif sum2 > sum1:
            diff = sum2 - sum1
            if zero_count1 == 0 or (diff + zero_count1) % zero_count1 != 0:
                return -1
            return sum2 + zero_count2
        else:  # sums are already equal
            if zero_count1 or zero_count2:
                return sum1 + max(zero_count1, zero_count2)
            return sum1  # sums are equal and no zeros to replace

        # Adjusting for when zeros need to be replaced to balance out the sums
        additional = max(zero_count1, zero_count2)
        if sum1 == sum2:
            return sum1 + additional
        return max(sum1, sum2) + additional
